import React from "react";
import { Navbar, Nav, NavDropdown, NavbarBrand } from "react-bootstrap";
import logo from "../../assets/IMG_0023.jpg";
import "../../App.css";

const TopNavBar = () => {
  return (
    <Navbar collapseOnSelect expand="lg" bg="transparent" variant="light">
      <NavbarBrand>
        <img
          width={100}
          height={100}
          alt=""
          src={logo}
          className="logo"
          style={{ borderColor: "transparent" }}
        />
      </NavbarBrand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />

      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav
          className="mx-auto justify-content-between"
          activeKey="#mens"
          onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
        >
          <Nav.Link href="#mens">Mens</Nav.Link>
          <Nav.Link href="#womens">Womens</Nav.Link>
          <NavDropdown title="Accessories" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/shoecare">
              Shoe Care
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/laces">Laces</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.4">Shoe Inserts</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.5">
              Cream & Polish
            </NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href="#byrequest">By Request</Nav.Link>
          <Nav.Link eventKey={2} href="#aboutus">
            Heritage
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNavBar;
